  KEY `FKboypk0xtjwlp0xwwv5a4loryn` (`id_user`),
  CONSTRAINT `FKboypk0xtjwlp0xwwv5a4loryn` FOREIGN KEY (`id_user`) REFERENCES `tb_user` (`id_user`),
